import React from "react";
import "./Breadcrumb.css";
const Breadcrumb = ({ image, title, subtitle,imageName }) => {
  return (
    <section className="breadcrumb">
      <figure style={{backgroundImage: `url(${"../../images/"})`}} className="breadcrumb__container">
      <img className="breadcrumb-image" src={image} alt={imageName}/>
        <h3>{subtitle}</h3>
        <h2>{title}</h2>
      </figure>
    </section>
  );
};

export default Breadcrumb;
